Love myself some Jon Stewart. Now, @peter_taunton , I have been watching your stories on this topic of drag queens reading and dancing in front of children and am interested to know what bothers you about it so much? Little boys not being shown just one way of how to express themselves as a ‘free’ human being -OR- their bodily safety? Because it seems to me like emotionally repressed men stuck in toxic masculinity norms are the most angry, mentally ill, and have been abusing the children of the world physically, emotionally, and sexually for thousands of years. Why is that? It’s us living in survival mode and through famines and such sure, but maybe it’s also because they are not allowed to be free to show up in the world however they want. Is it safety that bothers you the most - or change? 
Maybe if humans learned to authentically LOVE  and RESPECT each-other for who they are, there wouldn’t be so much violence and abuse in the first place. There wouldn’t be so many mentally sick individuals. 
